  

// TypeScript Version: 4.1

/**
* Tests if two numbers are coprime.
*
* @param a - first value
* @param b - second value
* @returns boolean indicating whether the two values are coprime
*
* @example
* var bool = isCoprime( 14.0, 15.0 );
* // returns true
*
* @example
* var bool = isCoprime( 14.0, 21.0 );
* // returns false
*/
declare function isCoprime( a: number, b: number ): boolean;


// EXPORTS //

export = isCoprime;
